import { Component, Input, Output, EventEmitter } from '@angular/core';
import { Expense } from '../../models/expense.model';

@Component({
  selector: 'app-expense-list',
  templateUrl: './expense-list.component.html',
  styleUrls: ['./expense-list.component.css']
})
export class ExpenseListComponent {
  @Input() expenses: Expense[] = [];
  @Output() onEdit = new EventEmitter<Expense>();
  @Output() onDelete = new EventEmitter<string>();

  editExpense(expense: Expense): void {
    this.onEdit.emit(expense);
  }

  deleteExpense(id: string | undefined): void {
    if (id) {
      this.onDelete.emit(id);
    }
  }

  formatDate(date: Date | string): string {
    return new Date(date).toLocaleDateString();
  }

  getCategoryColor(category: string): string {
    const colors: { [key: string]: string } = {
      'Food': '#f56565',
      'Transportation': '#ed8936',
      'Entertainment': '#ecc94b',
      'Bills': '#48bb78',
      'Shopping': '#38b2ac',
      'Health': '#4299e1',
      'Other': '#9f7aea'
    };
    return colors[category] || '#a0aec0';
  }
}


<div class="card">
  <h2>Recent Expenses</h2>
  
  <div *ngIf="expenses.length === 0" class="empty-state">
    <p>No expenses yet. Add your first expense to get started!</p>
  </div>

  <div class="expense-list" *ngIf="expenses.length > 0">
    <div class="expense-item" *ngFor="let expense of expenses">
      <div class="expense-header">
        <div class="expense-title-section">
          <h3>{{ expense.title }}</h3>
          <span 
            class="category-badge" 
            [style.background-color]="getCategoryColor(expense.category)">
            {{ expense.category }}
          </span>
        </div>
        <div class="expense-amount">${{ expense.amount.toFixed(2) }}</div>
      </div>
      
      <div class="expense-details">
        <p class="expense-date">{{ formatDate(expense.date) }}</p>
        <p class="expense-description" *ngIf="expense.description">
          {{ expense.description }}
        </p>
      </div>
      
      <div class="expense-actions">
        <button class="btn btn-secondary btn-sm" (click)="editExpense(expense)">
          Edit
        </button>
        <button class="btn btn-danger btn-sm" (click)="deleteExpense(expense._id)">
          Delete
        </button>
      </div>
    </div>
  </div>
</div>
